import styles from "./index.module.scss";
import { RoomCard } from "./RoomCard";
import { dataRoomsCard } from "./../../../data.js";

export const Rooms = () => {
  return (
    <div className={styles.rooms}>
      <h2>Комнаты</h2>
      {dataRoomsCard.map((card, index) => {
        return <RoomCard key={index} data={card} />;
      })}
      <RoomCard />
    </div>
  );
};
